var fu = require('../')
var _ = require('lodash')

var data = [1,2,3,4,5,6,7,8,9]

var even = function (n) {
  return n % 2 === 0
}

function _lodash() {
  return _.first(_.filter(data, even))
}

function _fu() {
  return fu.filter(even, data)[0]
}

require('./')({
  'lodash': _lodash,
  'fu': _fu,
})
